import React from 'react'

export default function Credits() {
    return (
        <footer>
            <address>Created by <a href="https://github.com/FooLeeSze/fcc-random_quote_machine" target="_blank" rel="noreferrer" >Lee Sze Foo</a></address>
            <ul id="resources">
                <li>Photo by <a href="https://www.pexels.com/photo/mountain-covered-snow-under-star-572897/" target="_blank" rel="noreferrer">eberhard grossgasteiger</a></li>
                <li>Quotes from <a href="https://github.com/lukePeavey/quotable" target="_blank" rel="noreferrer">Quotable</a></li>
                <li>Twitter icon from <a href="https://icons8.com/icons/set/twitter" target="_blank" rel="noreferrer">Icons8</a></li>
            </ul>
        </footer>
    )
}
